import React, {ReactNode} from "react";

class Proposal extends React.Component<{content: string}, any> {
    public render(): ReactNode {
        return (
            <div
                className={'pl-sm-1 rounded proposal'}
            >{this.props.content}</div>
        );
    }
}

export default Proposal;
